  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The National Sexual Violence Resource
  Center (NSVRC) is a national information and resource hub relating to all aspects
  of sexual violence.</p>n<p>NSVRC staff collect and disseminate a wide range of resources
  on sexual violence including statistics, research, position statements, statutes,
  training curricula, prevention initiatives and program information. With these resources,
  NSVRC assists coalitions, advocates and others interested in understanding and eliminating
  sexual violence. NSVRC has an active and diverse Advisory Council that assists and
  advises staff and ensures a broad national perspective. NSVRC also enjoys a strong
  partnership with state, territory and tribal anti-sexual assault coalitions and
  allied organizations.</p>n<p>NSVRC is funded through a cooperative agreement from
  the Centers for Disease Control and Prevention (CDC) Division of Violence Prevention.</p>n\",\n\t\"license_title\":
